INSERT INTO `pagina` VALUES (1,'Home',NULL,'home','S','home','N','N','N','N','S','N','Home - Real Money Transfer','Real Money Transfer is a company specializing in international transactions and sending money to companies and individuals.\r\nHigh standard of excellence in international money sending services.','Money Transfer Send Money how send money?',NULL,NULL,NULL,NULL,NULL,NULL),(2,'About ','<p>For any business or individual anywhere in world, Real money <strong>Transfer</strong> makes it easy to send money abroad. We are a growing money remittance company based in London, and we are always making sure that our clients are satisfied and happy with our service . We continue to innovate, developing new ways to send money abroad. We know that moving your money around the world means a lot more than just changing british pounds to Real, or euros to any other currency. Real Money Transfer believes that when money moves, better things can happen. A child goes to school or university. Many opportunities opens, a community heals and relationships endure. Whatever your story, we want it to have the perfect ending. We&rsquo;ll go out of our way to make that happen, and will make sure every payment has a happily ever after.</p>\r\n','Empresa','S','about','S','N','S','N','S','N','About','cdscds','dcscds',NULL,NULL,NULL,NULL,NULL,'Real money transfer is a leader in payment services'),(3,'Privacy Policy','<p>This Privacy Policy explains how we at Real Money Transfer obtain, use and disclose your personal data and how you can contact us if you have any questions or want to exercise any of your privacy rights. Real Money Transfer takes its privacy responsibilities very seriously and has implemented measures designed to protect your personal data and ensure compliance with applicable laws..</p>\r\n','Parceiros','S','privacy-policy','S','N','N','N','S','N','privacy-policy','privacy-policy','privacy-policy',NULL,NULL,NULL,NULL,NULL,'Privacy Policy.'),(4,'Help ','<p><span style=\"